import "../../styles/login/Login.css";
import Logo from "../../image/logo.png"

function Login() {
  return (
    <div>
      <div className="login-header">
        <p>더재팬홈</p>
        <p>문의하기</p>
      </div>

      <div className="login-box">
        <div className="logo-box">
          <img src={Logo} alt="" />
        </div>

        <div className="login-info-box"></div>
      </div>
    </div>
  );
}

export default Login;
